import React, {useEffect} from 'react';
import Layout from '../../components/Layout';
import { SectionTitle, Pill } from '../../styles';
import {ProjectItem, ProjectTitle, SkillContainer} from './styles';
import {ImageContainer,ProjectDetailsContainer, VideoContainer} from "./styles";
import ReactPlayer from 'react-player';
import { Grid } from '@material-ui/core';



const Projects = ({ user }) => {

    useEffect(() => {
        //console.log(user.projects.images[0].resolutions.desktop.url);
        //console.log(user);
        user.projects.map((project, index) => (
            project.videos.map((video, j) => (
                console.log(video.url)
                //.map((format, i) =>(
                   //console.log(format)
                //))
            ))
        ));
    }, []);

  return (
    <Layout user={user}>
      <div>
        <SectionTitle>Projects</SectionTitle>
        <ul>
          {user.projects.map((project, i) => (
            <ProjectItem key={i}>
              <ProjectTitle>{project.displayName}</ProjectTitle>
                <SkillContainer>
                    {[...project.languages, ...project.libraries,].map((item, j) => (
                        <Pill key={j}>{item}</Pill>
                    ))}
                </SkillContainer>
                <ProjectDetailsContainer>

                    <Grid container direction="row" alignItems="right">
                        <Grid item>
                            <p>{project.summary}</p>
                        </Grid>
                        <Grid item>
                            {project.images.map((image, j) => (
                                image.resolutions.desktop.url.length ?
                                    <ImageContainer src= {image.resolutions.desktop.url}/> : null

                            ))}

                            {project.videos.map((video, j) => (
                                video.url.length ?
                                    <VideoContainer> <ReactPlayer url= {video.url} /></VideoContainer> : null

                            ))}
                        </Grid>
                    </Grid>






                </ProjectDetailsContainer>











            </ProjectItem>
          ))}
        </ul>
      </div>
    </Layout>
  );
};

export default Projects;
